-- ----------------------------
-- Event structure for `statistics`
-- ----------------------------
DROP EVENT IF EXISTS `statistics`;
DELIMITER ;;
CREATE DEFINER=``@`` EVENT `statistics` ON SCHEDULE EVERY 2 HOUR STARTS '2014-03-26 22:00:00' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
DROP TABLE if exists statistics;
CREATE TABLE statistics
(
statistics_id int(11) not null PRIMARY KEY auto_increment,
waste_category_code VARCHAR(255),
production_unit_name VARCHAR(255),
waste_weight DOUBLE(255,6)
);
SELECT waste_category_code,production_unit_name,SUM(waste_weight) 
from manifest 
INNER JOIN production_unit 
ON manifest.production_unit_id = production_unit.production_unit_id 
GROUP BY production_unit_name,waste_category_code;
END
;;
DELIMITER ;
